import styled from 'styled-components'
import Image from 'next/image'

const CheckList = () => {

    return (
        <Container>
            <Image
                src="/coding.png"
                width={500}
                height={500}
            />
            />


        </Container>
    )

}

const Container = styled.div` 
    display: flex;
    flex-direction: column;
    
`

export default CheckList
